import React, { Component } from "react";

class ProfileCreds extends Component {
  render() {
    return (
      <div>
        <div className="row">
          <div className="col-md-12">
            <div className="card card-body m-auto bg-light py-3">creds</div>
          </div>
        </div>
      </div>
    );
  }
}
export default ProfileCreds;
